import React from 'react';
import {Route, Routes} from 'react-router-dom'
import {routes} from "./routes";

const AppRouter = () => {
    return (
        <Routes>
            {routes.map(item => {
                return <Route path={item.path} element={<item.element/>} key={item.path}/>
            })}
        </Routes>
    );
};

export default AppRouter;
